import { useSelector } from "react-redux"
import Card from "../Card/Card"

const Fav=()=>{
    const favorites=useSelector((state)=>state.myFavorites)
    {favorites.map((id, name, status, species, gender, image)=>{
        return(
            <Card
            key={id}
            id={id}
             name={name}
             status={status}
             species={species}
             gender={gender}
             image={image}
            />
        )
    })}
    
}

export default Fav
